import React, { Component } from 'react';

export default class Badge extends Component {

    render() {
        return (
            <div className="badges">
                <iframe src="https://api.badgr.io/public/assertions/E-VU94QrQ3GWaqnDg1q2Og?embedVersion=1&amp;embedWidth=330&amp;embedHeight=186" title="Badge: Responsiveness skills"></iframe>
                <iframe src="https://api.badgr.io/public/assertions/DdT1JSu5S8-3hSNh2Z4-1g?embedVersion=1&amp;embedWidth=330&amp;embedHeight=186&amp;identity__email=maxime.ad.christiaens%40gmail.com"></iframe>
                <blockquote class="badgr-badge"><a href="https://api.badgr.io/public/assertions/DdT1JSu5S8-3hSNh2Z4-1g?v=1_1"><img src="https://api.badgr.io/public/badges/LPJax9V7QKu4Cqxfez_oZg/image?type=png"></img></a><p class="badgr-badge-name">CSS framework - level 2</p><p class="badgr-badge-date"><strong>Awarded:</strong> Jan 23, 2019</p><p><a class="badgr-badge-verify" target="_blank" href="https://badgecheck.io?url=https://api.badgr.io/public/assertions/DdT1JSu5S8-3hSNh2Z4-1g?v=1_1">VERIFY</a></p><script async="async" src="https://badgr.io/widgets.bundle.js"></script></blockquote>
            </div>
        );
    }
}
